import React from "react";
import { FaHeartbeat, FaBrain, FaBone, FaPhone, FaHospital } from "react-icons/fa";
import { MdTipsAndUpdates } from "react-icons/md";
import { useNavigate } from "react-router-dom";
import "../index.css";

const Dashboard = () => {
  const navigate = useNavigate();

  const exerciseCards = [
    {
      title: "Cardiac Rehab",
      icon: <FaHeartbeat size={28} className="text-red-500" />,
      label: "Heart Health",
      exercises: "Improve your heart health with guided exercises.",
      link: "/exercise/cardiac",
      button: "Start"
    },
    {
      title: "Orthopedic Rehab",
      icon: <FaBone size={28} className="text-blue-600" />,
      label: "Joint Recovery",
      exercises: "Rebuild strength after orthopedic procedures.",
      link: "/exercise/ortho",
      button: "Start"
    },
    {
      title: "Neuro Rehab",
      icon: <FaBrain size={28} className="text-purple-500" />,
      label: "Neurological Recovery",
      exercises: "Support neuroplasticity through movement.",
      link: "/exercise/neuro",
      button: "Start"
    },
    {
      title: "Physiotherapy",
      icon: <MdTipsAndUpdates size={28} className="text-green-600" />,
      label: "Full-body Mobility",
      exercises: "Maintain flexibility and functional movement.",
      link: "/exercise/physio",
      button: "Start"
    },
    {
      title: "Contact Us",
      icon: <FaPhone size={28} className="text-orange-500" />,
      label: "We care about you",
      exercises: "Reach out to our rehab experts anytime.",
      link: "/contact",
      button: "Know More"
    },
    {
      title: "Best Rehab Center",
      icon: <FaHospital size={28} className="text-pink-500" />,
      label: "Find Near You",
      exercises: "Discover top-rated rehab centers nearby.",
      link: "/centers",
      button: "Find"
    },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-b from-white via-blue-50 to-white">
      <header className="bg-blue-800 text-white px-6 py-4 flex justify-between items-center shadow">
        <h1 className="text-xl sm:text-2xl font-semibold">AI Rehab Dashboard</h1>
        <nav className="space-x-4 text-sm">
          <a href="/home" className="hover:underline">Home</a>
          <a href="/profile" className="hover:underline">Profile</a>
          <a href="/logout" className="hover:underline">Logout</a>
        </nav>
      </header>

      <main className="p-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
        {exerciseCards.map((card, index) => (
          <div
            key={index}
            className="bg-white rounded-xl border border-gray-200 shadow-sm hover:shadow-md p-5 transition-transform duration-300 transform hover:scale-105 flex flex-col justify-between"
          >
            <div className="flex items-center gap-3 mb-3">
              {card.icon}
              <div>
                <h2 className="text-lg font-semibold text-gray-800">{card.title}</h2>
                <p className="text-xs mt-1 font-semibold inline-block px-3 py-1 rounded-full bg-yellow-400 text-white">
                  {card.label}
                </p>
              </div>
            </div>
            <p className="text-sm text-gray-600 mb-6">{card.exercises}</p>
            <button
              className="bg-blue-600 text-white text-sm font-medium py-2 rounded-md hover:bg-blue-700 transition"
              onClick={() => navigate(card.link)}
            >
              {card.button}
            </button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
